import React, { useState } from "react";
import Bin from "./Bin";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';

const Header = () => {
  const [showBin, setShowBin] = useState(false);
  const [showLoginModal, setShowLoginModal] = useState(false);
  const [showRegisterModal, setShowRegisterModal] = useState(false);

  const handleToggleBin = () => {
    setShowBin(!showBin);
  };

  const handleLoginClick = () => {
    setShowLoginModal(true);
  };

  const handleRegisterClick = () => {
    setShowRegisterModal(true);
  };

  const closeLoginModal = () => {
    setShowLoginModal(false);
  };

  const closeRegisterModal = () => {
    setShowRegisterModal(false);
  };

  return (
    <div>
      <header className="fixed-top bg-dark text-white p-3">
        <div className="container">
          <nav className="navbar navbar-expand-lg navbar-dark">
            <a className="navbar-brand navttext" href="#top">PriceComparison</a>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarNav"
              aria-controls="navbarNav"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
              <ul className="navbar-nav">
                <li>
                  <button onClick={handleToggleBin}>
                    {showBin ? "Спрятать корзину" : "Показать корзину"}
                  </button>
                </li>
                <li>
                  <button onClick={handleRegisterClick}>Зарегистрироваться</button>
                </li>
                <li>
                  <button onClick={handleLoginClick}>Войти</button>
                </li>
              </ul>
            </div>
          </nav>
        </div>
      </header>

      {/* Conditionally render the StickyBin */}
      {showBin && <Bin />}

      {/* Login Modal */}
      {showLoginModal && (
        <div className="modal show" tabIndex={-1} role="dialog" style={{ display: 'block', background: 'rgba(0, 0, 0, 0.5)' }}>
          <div className="modal-dialog" role="document">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">Войти</h5>
                <button type="button" className="btn-close" aria-label="Close" onClick={closeLoginModal}></button>
              </div>
              <div className="modal-body">
                <p>Логин и пароль...</p>
                {/* Add your login form here */}
              </div>
              <div className="modal-footer">
                <button type="button" className="btn btn-secondary" onClick={closeLoginModal}>Закрыть</button>
                <button type="button" className="btn btn-primary">Войти</button>
              </div>
            </div>
          </div>
        </div>
      )}

      {/* Register Modal */}
      {showRegisterModal && (
        <div className="modal show" tabIndex={-1} role="dialog" style={{ display: 'block', background: 'rgba(0, 0, 0, 0.5)' }}>
          <div className="modal-dialog" role="document">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">Зарегистрироваться</h5>
                <button type="button" className="btn-close" aria-label="Close" onClick={closeRegisterModal}></button>
              </div>
              <div className="modal-body">
                <p>Введите регистрационные данные...</p>
                {/* Add your registration form here */}
              </div>
              <div className="modal-footer">
                <button type="button" className="btn btn-secondary" onClick={closeRegisterModal}>Закрыть</button>
                <button type="button" className="btn btn-primary">Зарегистрироваться</button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Header;
